import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBarComp from './components/NavBar/NavBar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ItemListContainer from './components/NavBar/ItemListContainer';
import ItemDetailContainer from './components/NavBar/ItemDetailContainer'
import { CartContext } from './components/NavBar/CartContext';

const App = () => {

  return (
    <CartContext.Provider value={"coder"}>
      <BrowserRouter>
        <NavBarComp/>
        <Routes>
          <Route path="/" element={<ItemListContainer/>}/>
          <Route path="/categoryId/:id" element={<ItemListContainer/>}/>
          <Route path="/item/:id" element={<ItemDetailContainer/>}/>
        </Routes>
      </BrowserRouter>
    </CartContext.Provider>
  );
}

export default App;
